%[text] %[text:anchor:T_902a] # Exercise 2: Structural Analysis in MATLAB
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] **Introduction**
%[text] It is important to reflect the reality as accurate as possible in the computational model. The boundary conditions play a very important role in accurately capturing the real structural behavior using computational methods. In this exercise you will explore how to apply correctly boundary conditions based on an engineering schematic of the swingarm using the [Partial Differential Equation Toolbox](https://www.mathworks.com/products/pde.html)™. Also, how to apply properties, mesh, and finally solve a structural analysis problem using [Partial Differential Equation Toolbox](https://www.mathworks.com/products/pde.html)™. You can then visualize the results of the *Finite Element Analysis* (FEA) using the [Visualize PDE Results](https://www.mathworks.com/help/pde/ug/visualizepderesults.html) Live Task. And finally, you will compute the strain energy for a given load case. 
%[text] ![swingarm - technical characteristics.png](text:image:767e)
%[text] <u>**To interact with this Exercise: **</u>
%[text] **Whenever you see the icon **![Try this icon](text:image:9648), \*\*this will indicate the specific steps you should take to complete the section of the exercise. \*\*Also, instead of executing the whole script, run each section separately (see below) or using the keyboard shortcut (`Ctrl+Enter`): 
%[text] ![Run Section.png](text:image:0759) 
%%
%[text] %[text:anchor:H_4fdd] ## 1) Add the Auxiliary Functions into MATLAB's Path
%[text] First, you will add the *Auxiliary Functions* folder into MATLAB's path to ensure the sections below will run smoothly. 
%[text] ![Try this icon](text:image:3f74) <u>Run this section of code to add the corresponding files to the path</u>: 
clear, env_conf;
%[text] You can verify whether the folder containing the auxiliary functions has been added into MATLAB's path by executing the following line of code and by verifying, that function applyBoundaryConditions is found
%[text] ```matlabCodeExample
%[text] which applyBoundaryConditions
%[text] ```
%%
%[text] %[text:anchor:H_759e] ## 2) Create a Finite Element Model with Geometry
%[text] ![Try this icon](text:image:9779) Complete the code below by removing the comment (<u>remove the percent sign </u><u>`%`</u><u> infront of the line of code</u>):
% geomFileName = fullfile(".", "geometry", "swingarm solid.step");
structModel = femodel(AnalysisType="structuralStatic", Geometry=geomFileName);
pdegplot(structModel, EdgeLabels="off", FaceLabels="on", FaceAlpha=0.5)
%[text] ![Try this icon](text:image:6b87) Run this section of code by using "Run Section" in the toolstrip or clicking the "Run Code Section" button below:
  %[control:button:766e]{"position":[1,2]}
%%
%[text] %[text:anchor:H_51d3] ## 3) Set Material Properties, Apply Boundary Conditions and Solve the Structural Problem
%[text] Now, you can set the material properties and apply appropriate boundary conditions needed to solve the problem numerically. 
%[text] %[text:anchor:H_80df] **Set material properties**
structModel.MaterialProperties = materialProperties(YoungsModulus=200e9, ...
                                                    PoissonsRatio=0.28, ...
                                                    MassDensity=7800);
%[text] %[text:anchor:H_4194] **Apply Dirichlet and Neumann boundary conditions**
%[text] ![Try this icon](text:image:0a51) Complete the code below by removing the comment (<u>remove the percent sign </u><u>`%`</u><u> infront of the line of code</u>):
% structModel = applyBoundaryConditions(structModel); %[text:anchor:M_M_M_8906]
%[text] %[text:anchor:H_49d6] **Mesh the geometry**
structModel = generateMesh(structModel, "Hmax", 0.02, "Hmin",0.005);
pdemesh(structModel)
%[text] %[text:anchor:H_25de] **Solve the problem**
results = solve(structModel);
%[text] ![Try this icon](text:image:22e5) Run this section of code by using "Run Section" in the toolstrip or clicking the "Run Code Section" button below:
  %[control:button:9095]{"position":[1,2]}
%%
%[text] %[text:anchor:H_9dbc] ## 4) Postprocessing of the Results
%[text] ![Try this icon](text:image:2979) **Instructions**
%[text] 1. Make sure that you have successfully completed Section 3 and that an object "results" is available in the workspace ![Results.png](text:image:0261)
%[text] 2. Expand the dropdown list "Select Results" from the [Visualize PDE Results Live Task](internal:M_33ed) and select workspace variable results ![results2.png](text:image:07f6)
%[text] 3. Run this section of code by using "Run Section" in the toolstrip or clicking the "Run Code Section" button below: \
  %[control:button:69bd]{"position":[1,2]}
%[task:5a4b] %[text:anchor:M_M_M_33ed] %[task:5a4b]
%%
%[text] %[text:anchor:H_4d0e] ## 5) Computation of the strain energy
%[text] The strain energy is given by the formula $E\_{\\text{strain}} = \\int\_{\\Omega} \\mathbf{\\varepsilon} : \\mathbf{\\sigma} \\: \\text{d} \\Omega = \\, \\hat{\\mathbf{d}}^{\\text{T}} \\, \\mathbf{K} \\,\\hat{\\mathbf{d}}$. This is a measure of the strain, and subsequently the stress, stored into the deformable body. The higher the strain energy, the higher the stresses the deformable body undergoes.
%[text] \*\*Note: \*\*Make sure that you have successfully completed the tasks in the previous sections and that an object "results" is available in the workspace 
%[text] 
%[text] ![Try this icon](text:image:673b) Complete the code below by removing the comment (<u>remove the percent sign </u><u>`%`</u><u> infront of the line of code</u>):
femMatrices = assembleFEMatrices(structModel); %[text:anchor:M_M_M_5f87]
dispVct = [results.Displacement.ux; results.Displacement.uy; results.Displacement.uz];
checkProblemDimensions(femMatrices,dispVct)
% strainEnergy = transpose(dispVct)*femMatrices.K*dispVct;
disp("Strain Energy for the swingarm design is equal to: " + strainEnergy + " [Nm]")
